import InstagramIcon from '../images/ico-instagram.png';
import TikTokIcon from '../images/ico-tiktok.png';
import WhatsAppIcon from '../images/ico-whatsapp.png';

const Footer = () => {
  return (
    <footer>
        <p>Powered by</p>
        <img src="C:\Users\camil\fe3-final\public\images\DH.png" alt='DH-logo' />
        <img src="/images/ico-facebook.png" alt='facebook' />
        <img src="/images/ico-instagram.png" alt='instagram' />
        <img src="/images/ico-tiktok.png" alt='tiktok' />
        <img src="/images/ico-whatsapp.png" alt='whatsapp' />
    </footer>
  )
}

export default Footer
